function init() {

    scene = new THREE.Scene();

    root = new THREE.Group();

    scene.add( root );

    camera = new THREE.PerspectiveCamera(20, window.innerWidth / window.innerHeight, 1, 10000 );

    camera.position.x = 929.437;
    camera.position.y = -4232.0611;
    camera.position.z = -103.0726;

    camera.rotation.x = 1.5951;
    camera.rotation.y = 0.2161;
    camera.rotation.z = -1.6838;

    root.rotation.x = 0.05;
    root.rotation.y = -0.3;
    root.rotation.z = 0.15;

    root.position.x = 0;
    root.position.y = 0;
    root.position.z = 0;




    scene.add( camera );


    scene.add(new THREE.AmbientLight(0xffffff,0.6));
    var light = new THREE.DirectionalLight(0x404040, 0.6);
    light.position.set(-1,-1,-1);
    scene.add( light );
    var light = new THREE.DirectionalLight(0x404040, 0.6);
    light.position.set(-1,-1,1);
    scene.add( light );

    renderer = new THREE.WebGLRenderer( { antialias: true } );
    renderer.setClearColor( 0xffffff );
    renderer.setPixelRatio( window.devicePixelRatio );
    renderer.setSize( window.innerWidth, window.innerHeight );
    container.appendChild(renderer.domElement);

    controls = new THREE.OrthographicTrackballControls(camera, renderer.domElement);

    controls.enableDamping = true;
    controls.dynamicDampingFactor = 0.1;



    controls.enableZoom = false;
    controls.noZoom = true;
    controls.noPan = true;
    controls.enablePan = false;




    controls.rotateSpeed = 1;


    camera.updateProjectionMatrix();


    createMenu();

    window.addEventListener( 'resize', onWindowResize, false );
    loadMolecule(MOLECULES["RP"]);








}

function generateButtonCallback( data ,m) {

    return function ( event ) {
        console.log(camera,root);
        loadMolecule( data );



        controls.reset();
        switch (m)
        {
            case "RP":
            case "RFC":
            case "RBC":
            case "RC":
                camera.position.x = 929.437;
                camera.position.y = -4232.0611;
                camera.position.z = -103.0726;

                camera.rotation.x = 1.5951;
                camera.rotation.y = 0.2161;
                camera.rotation.z = -1.6838;

                root.rotation.x = 0.05;
                root.rotation.y = -0.3;
                root.rotation.z = 0.15;


                break;

            case "HEX":
            case "HEXCMP":

                camera.position.x = 460;
                camera.position.y = -1012;
                camera.position.z = 4189;

                camera.rotation.x = 0.7581;
                camera.rotation.y = 0.1064;
                camera.rotation.z = 0.00002;

                root.rotation.x = 0.05;
                root.rotation.y = -0.3;
                root.rotation.z = 0.15;

                break;
        }
        $('.js-title').html(TITRES[m]);

    }

}

function createMenu() {
    var first = true;
    for ( var m in MOLECULES ) {
        var label = document.createElement( 'label' );
        if(first)
        {
            label.setAttribute("class", "o-choices__item is-selected");
            first = false;
        }
        else
        {
            label.setAttribute("class", "o-choices__item");
        }
        var input = document.createElement( 'input' );
        input.setAttribute("type","radio");
        input.setAttribute("name","model");
        input.setAttribute("value",m);


        var img = document.createElement('img');
        img.setAttribute("src","assets/png/crystals/"+m+".png");
        img.setAttribute("width","40%");

        label.appendChild(img);
        label.appendChild(input);

        menu.appendChild( label );

        label.addEventListener( 'click', generateButtonCallback( MOLECULES[ m ],m ), false );
    }


    menu.appendChild( label );

}

